Here is our updated menu!

SPECIAL MENU $22 PREORDER ONLY at least a day ahead.

-Moriawase Kushiyaki Bento (8 grilled sticks chefs choice) comes with rice, Chawan mushi, small dessert. 

-Kaisen Don (saba, salmon, tako, hamachi, ebi, pickles over sushi rice). Comes with small dessert and chawan mushi.

STARTING SUNDAY SEPTEMBER 6. *Limited orders* MISOYAKI TRIO BENTO! $22.

This bento will have our special miso mayo blend lathered over our sashimi grade salmon, ono, and monchong.  We butter saute it to perfection.  Served with rice, pickles, small dessert and chawan mushi.

Just some important info.  WE ARE OPEN 11AM-6PM unless we post closing.  Preorders would help us a lot, but we do take same day, last minute orders and walkins.  The kushiyaki bento and kaisen don is preorder only, and the misoyaki trio bento starts on sunday.

We added the wafu beef and pork hamburger steak (with ponzu and daikon oroshi) to the regular menu!

If we add anything to the menu or do specials and you already put an order just let us know you want to update your order NO PROBLEM!

Right now we are taking orders up to September 9th.  We are not too sure as of this minute what's happening with dine in.  Once we have a set plan we will let you folks know what our bento schedule will be according to the lockdown.

We are taking reservations from September 11th- September 30th, in Hope's that dine in reopens.  Please refer to our posts about our dine in with the kaiseki menu and kohkyu sukiyaki.

mahalo for reading all of this and have a great day!

